fn fibonacci_184() -> Field {
    let mut a: Field = 0;
    let mut b: Field = 1;

    for _ in 1..100 {  // We need for loop range to be known at compile time
        let temp = a + b;
        a = b;
        b = temp;
    }

    b
}


fn main(result: pub Field) {
    // let expected = fibonacci_350();
    // assert (result == expected);

    let expected = fibonacci_184();
    assert (result == expected);


}
